import React, { useState } from "react";

export const Faq = () => {
  const [questions, setQuestions] = useState([
    { title: "Title of the question", comment: "the answers to the questions" },
    { title: "Title of the question", comment: "the answers to the questions" },
    { title: "Title of the question", comment: "the answers to the questions" },
    { title: "Title of the question", comment: "the answers to the questions" },
  ]);
  return (
    <section className="">
      <div className="text-center">
        <h1>FAQS</h1>
        <p>Have any questions? Here are answers to some of them</p>
      </div>

      <div className="border-4 mx-auto border-red-600 w-faqWidth">
        {questions.map((question) => (
          <div>
            <div className="border-4 flex justify-between">
              <p>{question.title}</p> <p>+</p>
            </div>
            <div className="flex justify-between">
              <p>{question.comment}</p> <p>-</p>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
};
